import React, { useState } from "react";

const Login = ({ userType }) => {
  const [username, setUsername] = useState(""); // Declare state for username
  const [password, setPassword] = useState(""); // Declare state for password

  const handleLogin = () => {
    if (!username || !password) {
      alert("Please enter both username and password");
      return;
    }

    // Logic for user type and redirection
    if (userType === "student") {
      console.log("Student logging in");
      // Navigate to student dashboard
    } else if (userType === "professor") {
      console.log("Professor logging in");
      // Navigate to professor dashboard
    } else {
      alert("Invalid user type!");
    }
  };

  return (
    <div>
      <h1>{userType === "student" ? "Student Login" : "Professor Login"}</h1>
      <form
        onSubmit={(e) => {
          e.preventDefault(); // Prevent form from refreshing
          handleLogin();
        }}
      >
        <label>Username:</label>
        <input
          type="text"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
        />
        <label>Password:</label>
        <input
          type="password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
        <button type="submit" onClick={handleLogin} >Login</button>
      </form>
    </div>
  );
};

export default Login;
